  [],\n\t\"revision_timestamp\": \"2016-07-27T22:55:32.535324\",\n\t\"name\": \"madison-wetland-management-district-annual-narrative-report-calendar-year-1986\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Madison
  WMD outlines accomplishments during the 1986 calendar year. The report begins with
  a summary of the year's highlights and weather conditions. The report includes a
  planning section which discusses compliance with environmental and cultural resource
  mandates and research and investigations. Administration is outlined; information
  about personnel, youth programs, volunteer programs, funding, safety, and technical
  assistance is given. Habitat management is also covered; subjects include wetlands,
  forests, croplands, grasslands, haying, fire management, pest control, water rights,
  and WPA easements. The wildlife section of the report discusses endangered and threatened
  species, waterfowl, marsh birds and waterbirds, shorebirds, raptors, game mammals,
  fisheries resources, animal control, and disease control. The public uses of the
  District described in this report include outdoor classrooms, interpretive programs,
  hunting, fishing, trapping, wildlife observation, outdoor recreation, and law enforcement.
  The equipment and facilities section of the report provides information about new
  construction, rehabilitation, and equipment replacement. Cooperative programs and
  items of interest are provided at the end. Field guides are attached.\",\n\t\"license_title\":
